import React from "react";
import { NavLink, Link, withRouter } from "react-router-dom";
const Nav = () => {
    return (
        <div id="nav">

            <Link to="/">Home</Link>
            <Link to="/counter">counter</Link>
        </div>
    )
}
export default Nav;
